import React from "react"
// import { Link } from "react-router-dom";

const Navbar = ()=>{
    return (
        <nav>
            <div class="title tooltip">GetIntern</div>
            
            <ul class="navbar">
                <a href="/">Home</a>
                <a href="/interns">Available Internships</a>
                <a href="/new-intern">Add Internship</a>
            </ul>
        </nav>
    );
}

export default Navbar;
